import Container from '../components/Container';
import Slider from '../components/Slider';
import Tips from '../components/Tips';

const Index = () => {
  return (
    <Container>
      <Slider />
      <Tips />
      <style jsx global>
        {`
          :root {
            /* Colors  */
            --yqmf-yellow: #ffdf2b;
            --yqmf-fucsia: #e43397;
          }
          * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
          }
        `}
      </style>
    </Container>
  );
};
export default Index;
